            title="Lely Open dag"
            datum="04-07-2022"
        />

        <Projectline
            title="Titel van het project van het project"
        />

        <Projectline
            title="Titel van het project van het project  2"
        />

        <Projectline
            title="Titel van het project van het project  3"
        />


    </section>
    </div>

          <div className= "pink--right">

              <Pinknavbutton

                  title= {username}
              />
          </div>

      </div>
</>
);
}

export default DashboardPage;
